console.log("custom js file loaded");
$(document).ready(function() {
  function showNew() {
    $('#new').fadeIn();
    $('#but').fadeOut();
  }
  function hideNew() {
    $('#new').fadeOut();
    $('#but').fadeIn();
  }

  function changeSelect() {
    var e = $('#project_id option:selected').text();
    $('#proj_text').text(e);
  }
});
